DROP TABLE IF EXISTS `tb_Order`;
CREATE TABLE `tb_Order`  (
  `Id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `OrderNo` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单编号',
  `OrderStatus` int(10) NOT NULL COMMENT '订单状态(-30:已取消 10:待付款 30:待发货 40:待收货 50:已送达 60:已收货 80:已完成)',
  `IsRefund` int(10) NOT NULL COMMENT '是否售后(-10:非售后 10:售后)',
  `CouponId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '优惠券ID',
  `PayType` int(10) NOT NULL COMMENT '支付方式(10余额支付 20微信支付 30云闪付)',
  `PayUserId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付人Id',
  `OrderPrice` decimal(10, 2) NOT NULL COMMENT '订单金额(优惠后,含运费)',
  `TotalGoodsPrice` decimal(10, 2) NOT NULL COMMENT '商品总金额(不含优惠折扣)',
  `CouponMoney` decimal(10, 2) NOT NULL COMMENT '优惠券抵扣金额',
  `PointsNum` int(10) NULL DEFAULT NULL COMMENT '积分抵扣数量(预留)',
  `PointsMoney` decimal(10, 2) NULL DEFAULT NULL COMMENT '积分抵扣金额(预留)',
  `FreightPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '运费',
  `UpdatePrice` decimal(10, 2) NOT NULL COMMENT '后台修改的订单金额',
  `PayPrice` decimal(10, 2) NOT NULL COMMENT '实际付款金额(包含运费)',
  `IsComment` int(10) NOT NULL COMMENT '是否已评价(-10:否 10:是)',
  `ParentId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '父节点Id',
  `SourceUserId` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '来源Id(上下级,隔开)',
  `PayTime` datetime NOT NULL COMMENT '付款时间',
  `SendTime` datetime NULL DEFAULT NULL COMMENT '发货时间',
  `ArrivedTime` datetime NULL DEFAULT NULL COMMENT '送达时间',
  `ReceivingTime` datetime NULL DEFAULT NULL COMMENT '确认收货时间',
  `DoneTime` datetime NULL DEFAULT NULL COMMENT '订单完成日期',
  `ExpressId` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流公司ID(预留)',
  `ExpressCompany` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流公司(预留)',
  `ExpressNo` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流单号(预留)',
  `PointsBonus` decimal(10, 2) NOT NULL COMMENT '赠送的积分数量',
  `PayTransactionId` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付交易号',
  `BuyerRemark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '买家留言',
